pragma solidity 0.4.24;

contract Pow{
  function exp10(uint baseE10,uint exp) returns(uint){
    return 1010000000;
  }
  function expCeil(uint base,uint exp) returns(uint){
    return 990000000;
  }
  function expFloor(uint base,uint exp) returns(uint){
    return 980000000;
  }


   // via: http://ethereum.stackexchange.com/questions/10425/is-there-any-efficient-way-to-compute-the-exponentiation-of-a-fraction-and-an-in/10432#10432
  // Computes `k * (1+1/q) ^ N`, with precision `p`. The higher
  // the precision, the higher the gas cost. It should be
  // something around the log of `n`. When `p == n`, the
  // precision is absolute (sans possible integer overflows).
  // Much smaller values are sufficient to get a great approximation.
  //           1000000, 68245410, 47304000, 8 <- should return 2000000
  function fracExp(uint k, uint q, uint n, uint p) returns (uint) {
    uint s = 0;
    uint N = 1;
    uint B = 1;
    for (uint i = 0; i < p; ++i){
      s += k * N / B / (q**i);
      N  = N * (n-i);
      B  = B * (i+1);
    }
    return s;
  }
}
